import React from "react";
import "../bulma/css/bulma.min.css";
import "../App.css";
import { useEffect } from "react";
import { useState } from "react";
import SortComponentAPI from "./CustomComponents/SortComponentAPI";

function TrustedLeadingBrandsAPI() {
  const parse = require("html-react-parser");

  const [data, setData] = useState([]);

  const apiGet = () => {
    fetch("http://127.0.0.1:5000/api_get_trusted_leading_brands")
      .then((respose) => respose.json())
      .then((json) => {
        console.log(json);
        setData(json);
      });
  };

  useEffect(() => {
    apiGet();
  }, []);

  const myData = data;

  return (
    <div>
      <div>
        <div className="SortContainer">
          <SortComponentAPI />
        </div>
        <div class="TrustedBrandsIconContainer">
          {myData.map((item, i) => {
            return <div>{item.company_name_tb01}</div>;
          })}
        </div>
        <div class="TrustedBrandsIconContainer">
          {myData.map((myData) => (
            <div className="TrustedBrandsIcon">
              {parse(myData.brand_image_tb01)}
            </div>
          ))}
        </div>
      </div>
    </div>
  );

